export class AppComponent {
  title = 'ToDoAppAngular';
}
<header>
  <nav class="navbar fixed-top navbar-dark bg-primary">
    <a class="navbar-brand" [routerLink]="['/']">ToDo App</a>
  </nav>
</header>

<section>
  <main class="container">
